import React, { Component } from "react";
import Table from './Table.js'
import Map from './Map.js'
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor(props) {
      super(props);
      this.state = { apiResponse: "" };
  }

  async callAPI() {
    const response = await fetch('http://34.220.181.170:9000/peers/get', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({ example: 'data' }),
    })
    var rj = await response.json()
    var id = rj.Nodes[0].Peer
    console.log(JSON.stringify(rj))
    if (id) {
      this.setState({Nodes : id})
    }

    // console.log(await response.json())

    // fetch("http://34.220.181.170:9000/testAPI")
    //       .then(res => res.text())
    //       .then(res => this.setState({ apiResponse: res }))
    //       .catch(err => err);
  }

  componentDidMount() {
      this.callAPI();
  }

  render() {
      return (
          <div className="App">
              <header className="App-header">
                  <img src={logo} className="App-logo" alt="logo" />
                  <h1 className="App-title">Welcome to React</h1>
                  <Table/>
                  <Map/>
              </header>
              <p className="App-intro">{this.state.Nodes}</p>
          </div>
      );
  }
}

export default App;
